import{_ as e,o as a,c as t,O as o}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 46.2-746.2:4 Members of the Special Forces Association; fee.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-746.2:4.md","filePath":"vacode/46.2-746.2:4.md"}'),i={name:"vacode/46.2-746.2:4.md"},s=o('<h1 id="§-46-2-746-2-4-members-of-the-special-forces-association-fee" tabindex="-1">§ 46.2-746.2:4 Members of the Special Forces Association; fee. <a class="header-anchor" href="#§-46-2-746-2-4-members-of-the-special-forces-association-fee" aria-label="Permalink to &quot;§ 46.2-746.2:4 Members of the Special Forces Association; fee.&quot;">​</a></h1><p>On receipt of an application therefor and presentation of written evidence that the applicant is a member of the Special Forces Association, the Commissioner shall issue to the applicant special license plates.</p><p>The provisions of subdivisions B 1 and 2 of § <a href="http://law.lis.virginia.gov/vacode/46.2-725/" target="_blank" rel="noreferrer">46.2-725</a> shall not apply to license plates issued under this section.</p><p>No license plates provided for in this section shall be issued unless and until the Commissioner receives at least 50 prepaid applications therefor and payment of a one-time fee of $3,500, less the total amount of $10 annual fees collected from the prepaid applications received.</p><p>2003, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0921" target="_blank" rel="noreferrer">921</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0932" target="_blank" rel="noreferrer">932</a>.</p>',5),r=[s];function n(c,l,p,f,h,d){return a(),t("div",null,r)}const u=e(i,[["render",n]]);export{m as __pageData,u as default};
